Introduction
ncloud



NAVER Cloud Platform(https://www.ncloud.com/) Library for Node.jsThis project is inspired from pkgcloud.Currently, this package supports geolocation only. The other functions are unstable.
Installing Dependencies
$ npm install ncloud
or
$ yarn add ncloud
Creating Instance
ES5
var ncloud = require('ncloud');
var client = ncloud.createClient({
        accessKey: "$ACCESS_KEY_ID$",
        secretKey: "$SECRET_KEY$",
});

ES6 or above
import * as ncloud from 'ncloud';

const client = ncloud.createClient({
     accessKey: "$ACCESS_KEY_ID$",
     secretKey: "$SECRET_KEY$",
});

Others
ncloud supports type definitions. It is readily available in typescript.

